import React from 'react';
import ReactDOM from 'react-dom';

const state = { is_favorites: false }

const App = () => {
  return (
    <div>
      Hello world
      <h1>{this.state.is_favorites}</h1>
    </div>
  );
}

ReactDOM.render(<App />, document.querySelector('#root'))
